branchCategory.description:
&lt;p&gt;
Floating joint series JS is made of stainless steel and used to increase corrosion resistance. JS uses a dust cover made of fluoro rubber or silicon rubber and is shaped to prevent residual liquid, therefore sealing is improved. Overall length as well as maximum tension and compression are the same as standard series JA.
&lt;/p&gt;

